import React, { useEffect } from 'react';
import { Widget, addResponseMessage } from 'react-chat-widget';
import Chatbot from 'react-chatbot-kit';
import 'react-chatbot-kit/build/main.css';
import MessageParser from "../chatbot/MessageParser";
import config from "../chatbot/config";
import ActionProvider from "../chatbot/ActionProvider";

import './style.css';
// import {myfunction} from './myfunction';


function Widgeticons() {
    const shoot = () => {
        
        var x = document.getElementById("show");
        
        if (x.style.display === "none") {
          x.style.display = "block";
         
        } else {
          x.style.display = "none";
        }
      }
    
     
      const showhide = () => {
        
         var x = document.getElementById("botvis");
         var y=document.getElementById("hide1");
         if (x.style.display === "none") {
           x.style.display = "block";
           y.style.display = "none";
         } else {
           x.style.display = "none";
           y.style.display = "block";
         }
       }
        
   
    return(<><div class='circle-container'>
    <div class="wrapper" id="show">
       <div id="hide1">
         <div class="tp icon facebook deg0">
            <div class="tooltip">
               Home
            </div>
            <span><i class="fas fa-home"></i></span>
         </div>
         <div class="tp icon twitter deg330">
            <div class="tooltip">
               Twitter
            </div>
            <span><i class="fab fa-twitter"></i></span>
         </div>
         <div class="tp icon instagram deg300">
            <div class="tooltip">
               Instagram
            </div>
            <span><i class="fab fa-instagram"></i></span>
         </div>
         </div>
         <div id="botvis">
      <Chatbot
        config={config}
        messageParser={MessageParser}
        actionProvider={ActionProvider}
      />
    </div>
         <div class="icon github deg135">
            <div class="tooltip">
               Chatbot
            </div>
            <button className='btnn' onClick={showhide}><span><i class="fas fa-comments "></i></span></button>
         </div>
         
      </div>

      
     <div class="wrapper center">
         <div class="icon expand">
            <div class="tooltip">
               Click 
            </div> 
            <button className='btnn' onClick={shoot}><span><i class="fas fa-dot-circle" ></i></span></button>
         </div>
     </div>

     
    </div>
</>
);
}
export default Widgeticons;
